import { PropTypes, bool } from "prop-types";

import { TransactionItem } from "./TransactionHistoryItem";
import { Table, TableHead, TableHeadItem } from "./Transaction.styled";


export function generateAlternateBoolean() {
let bool = true  
bool = !bool; // bool the value of 'bool' variable
  return bool;
}

export const TransactionHistory = ({ items =[] }) => {
    return <Table>
    <thead>
      <TableHead>
        <TableHeadItem>Type</TableHeadItem>
        <TableHeadItem>Amount</TableHeadItem>
        <TableHeadItem>Currency</TableHeadItem>
      </TableHead>
    </thead>

    <tbody>
        {items.map((item => {
          let bool = generateAlternateBoolean()
           (
          <TransactionItem 
          key={item.id}
          type={item.type}
          amount={item.amount}
          currency={item.currency}
          bool={bool}
          />

        )}))}
    </tbody>
  </Table>
} 

TransactionHistory.propTypes ={
    item : PropTypes.arrayOf(PropTypes.shape({
        id : PropTypes.string.isRequired,
    }))
}
